import React from 'react'
import { data } from './data'
import { Link } from 'react-router-dom'
import './logo.jpg'
const Home = () => {
  return (
    <div>
       {
        data.map((item)=>{
            return <section>
              <img src={item.data.image} alt={item.name}/>
              <p>{item.total}</p>

            </section>
        })
       }
    </div>
  )
}

export default Home
